import React from 'react';
import Tampil from './component/TampilBarang';
import Pencarian from './component/PencarianBarang';
import PerbandinganBarang from './component/PerbandinganBarang';
import { BrowserRouter as Router, Switch, Route, Link,Routes} from "react-router-dom";
import 'bootstrap/dist/css/bootstrap.min.css';


function App() {
  return (
    <>
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/Pencarian">About</Link>
            </li>
            <li>
              <Link to="/PerbandinganBarang">Users</Link>
            </li>
          </ul>
        </nav>

        {/* A <Switch> looks through its children <Route>s and
            renders the first one that matches the current URL. */}
        <Routes>
          <Route exact  path="/PerbandinganBarang" element={PerbandinganBarang}>
            <PerbandinganBarang />
          </Route>
          <Route exact  path="/" element={Tampil}>
            <Tampil />
          </Route>
        </Routes>
      </div>
    </Router>

    {/*<Tampil />
    <Pencarian />
    <PerbandinganBarang />*/}

    </>
  );
}

export default App;
